const login_form=document.getElementById("admin-login");login_form.addEventListener("submit",r=>{r.preventDefault();let o=new FormData(login_form);console.log(o),fetch("/admin/login",{method:"POST",body:o}).then(r=>r.json()).then(r=>{r.login?window.location.href="/admin/dashboard":Swal.fire({title:"Error",text:r.message,icon:"error",confirmButtonColor:"#f87c00"})}).catch(r=>{console.error(r),Swal.fire({title:"Error",text:"Internel Server Error",icon:"error",confirmButtonColor:"#f87c00"})})});